					["custom"] = "local MAX_HEALTH = 59381\n\nlocal function HandleConstructCast(allStates, destGUID, ...) \n    if allStates[destGUID] == nil then \n        allStates[destGUID] = {\n            show = true,\n            name = select(9, ...),\n            value = MAX_HEALTH,\n            total = MAX_HEALTH,\n            progressType = \"static\",\n            autoHide = false,\n            bShackled = false,\n            iSlow = 0,\n        }\n    end\n    allStates[destGUID].value = allStates[destGUID].value - select(15, ...)\n    allStates[destGUID].changed = true\n    \n    local iSpellID = select(12, ...)\n    if iSpellID == 40175 then \n        allStates[destGUID].bShackled = true\n    elseif iSpellID == 40157 then\n        allStates[destGUID].iSlow = allStates[destGUID].iSlow + 1\n    end\nend\naura_env.fnHandleConstructCast = HandleConstructCast\n\nlocal function HandleConstructDied(allStates, destGUID, ...) \n    if allStates[destGUID] ~= nil then \n        allStates[destGUID].show = false\n        allStates[destGUID].changed = true\n    end\nend\naura_env.fnHandleConstructDied = HandleConstructDied\n\n\nlocal function HandleConstructUnshackle(allStates, destGUID, ...) \n    if allStates[destGUID] ~= nil then \n        local iSpellID = select(12, ...)\n        if iSpellID == 40175 then \n            allStates[destGUID].bShackled = false\n        elseif iSpellID == 40157 then\n            allStates[destGUID].iSlow = 0\n        end\n    end\nend\naura_env.fnHandleConstructUnshackle = HandleConstructUnshackle\n\nlocal function HandleApplyGhost(allStates, destGUID, ...) \n    local sTarName = select(8, ...)\n    allStates[sTarName .. \"-Ghost\"] = {\n        show = true,\n        changed = true,\n        name = \"Ghost : \" .. WA_ClassColorName(sTarName),\n        progressType = \"timed\",\n        autoHide = true,\n        duration = 60,\n        expirationTime = GetTime() + 60,\n        bGhost = true,\n    }\nend\naura_env.fnHandleApplyGhost = HandleApplyGhost\n\n\nlocal function CleanUp(allStates) \n    for k, _ in pairs(allStates) do \n        allStates[k].show = false\n        allStates[k].changed = true\n    end\nend\naura_env.fnCleanUp = CleanUp\n\n",
