				["init"] = {
					["custom"] = "-- Setup tooltip scanner\nlocal tooltip_name = \"WA_TooltipScanner_\" .. gsub(aura_env.id,\" \",\"_\")\nlocal cTip\nif not _G[tooltip_name] then\n    cTip = CreateFrame(\"GameTooltip\",tooltip_name,nil,\"GameTooltipTemplate\")\n    cTip:SetOwner(UIParent, \"ANCHOR_NONE\")\n    cTip:SetBagItem(0, 1)\n    cTip:Show()\nend\ncTip = _G[tooltip_name]\n\naura_env.get_chest_enchant_duration = function()\n    local txt = \"\"\n    \n    cTip:SetInventoryItem('player',5)\n    \n    -- Loop over each line in the tooltip text of the item\n    for i = 1,cTip:NumLines() do\n        local left = _G[tooltip_name..\"TextLeft\"..i]\n        if left then\n            txt = txt .. \" \" .. (left:GetText() or \"\")\n        end\n        \n        local right = _G[tooltip_name .. \"TextRight\" .. i]\n        if right then\n            txt = txt .. \" \" .. (right:GetText() or \"\")\n        end\n    end\n    local min = string.match(string.lower(txt),string.lower(aura_env.config[\"EnchantName\"]) .. \" %((%d+) min%)\")\n    local hr = string.match(string.lower(txt),string.lower(aura_env.config[\"EnchantName\"]) .. \" %((%d+) hour%)\") \n    local sec = string.match(string.lower(txt),string.lower(aura_env.config[\"EnchantName\"]) .. \" %((%d+) sec%)\") \n    \n    if min then\n        return tonumber(min)\n    elseif hr then\n        return tonumber(hr)*60\n    elseif sec then\n        return tonumber(sec)/60\n    else\n        return 0\n    end\nend\n\n\n\n\n",
					["do_custom"] = true,
