				["init"] = {
					["custom"] = "aura_env.myID = 24114\n\n--braided chain = 24114\n--twilight owl = 24121\n--eye of night = 24116\n\n\naura_env.formatTime = function(seconds)\n    local t = round(seconds) / 3600\n    local h = math.floor(t, 1)\n    local m = math.floor(math.fmod(t, 1) * 60)\n    local s = math.floor(math.fmod((t * 60), 1) * 60)\n    \n    return \n    string.format(\"%02d\",m)..\":\"..string.format(\"%02d\",s)\nend\n\n\nlocal itemIDsToCheck = {aura_env.myID}\n\n\nfunction aura_env.checkCD(itemIDToCheck)\n    \n    local startTime, duration, enable = GetItemCooldown(itemIDToCheck)\n    \n    if startTime == 0 then\n        SendChatMessage(\"My \" .. select(2, GetItemInfo(itemIDToCheck)) .. \" is available\", \"Party\")\n        \n    elseif startTime ~= 0 then\n        local cooldownRaw = duration - (GetTime() - startTime)\n        local cooldown = aura_env.formatTime(cooldownRaw)\n        \n        SendChatMessage(\"My \" .. select(2, GetItemInfo(itemIDToCheck)) .. \" is on cooldown for \" .. cooldown, \"Party\")\n        \n    end\n    \nend\n\n\n\nfunction aura_env.checkAvailableActivations()\n    \n    local activators = itemIDsToCheck\n    \n    for i,v in ipairs(activators) do aura_env.checkCD(v) end\nend\n\n\n",
