					},
					["glow_thickness"] = 3,
					["glow_action"] = "show",
					["message_type"] = "SAY",
					["glow_frame_type"] = "UNITFRAME",
					["message_format_1.spellName_format"] = "none",
					["do_custom"] = false,
					["do_glow"] = false,
					["glow_type"] = "Pixel",
					["custom"] = "local LCG = LibStub(\"LibCustomGlow-1.0\")\nlocal triggers = WeakAuras.GetActiveTriggers(aura_env.id)\n\n\n\n--[[\nlocal frame = WeakAuras.GetUnitFrame(aura_env.state.destName)\nif frame ~= nil then\n    LCG.PixelGlow_Start(frame, {0.4,0.4,1,1}, 5, 0.5, nil, 3)\nend\n]]--\n\n\n",
					["do_sound"] = false,
					["message"] = "",
					["use_glow_color"] = true,
					["sound"] = "Interface\\Addons\\WeakAuras\\PowerAurasMedia\\Sounds\\BITE.ogg",
					["do_message"] = false,
				},
				["finish"] = {
					["hide_all_glows"] = false,
					["custom"] = "local LCG = LibStub(\"LibCustomGlow-1.0\")\n\n\nlocal frame = WeakAuras.GetUnitFrame(aura_env.state.destName)\nif frame ~= nil then\n    LCG.PixelGlow_Stop(frame)\nend\n\n\n\n",
					["do_custom"] = false,
				},
				["init"] = {
					["custom"] = "local tActiveDOTs = {}\nlocal fLastCast = nil\nlocal MAX_CAST_DELAY = 4\n\nlocal function CalculateCast(fTimeSeconds)     \n    if fLastCast == nil then \n        fLastCast = fTimeSeconds\n        return fTimeSeconds \n    end\n    \n    if fLastCast + MAX_CAST_DELAY < fTimeSeconds then\n        fLastCast = fTimeSeconds\n        return fTimeSeconds \n    end\n    \n    return fLastCast\nend\n\nlocal function GenerateName(allStates, sID)\n    allStates[sID].name = \"\"\n    for k, _ in pairs(allStates[sID].tTargetList) do \n        if allStates[sID].name ~= \"\" then \n            allStates[sID].name = allStates[sID].name .. \", \"\n        end\n        allStates[sID].name = allStates[sID].name .. WA_ClassColorName(k)\n    end\nend\n\nlocal function RemoveAura(allStates, sDestName) \n    if tActiveDOTs[sDestName] == nil then return end\n    \n    local sID = tActiveDOTs[sDestName].fTimeSeconds .. \"-\" .. tActiveDOTs[sDestName].iStacks\n    if allStates[sID] == nil then \n        tActiveDOTs[sDestName] = nil \n        return\n    end\n    \n    allStates[sID].changed = true\n    allStates[sID].tTargetList[sDestName] = nil \n    allStates[sID].count = allStates[sID].count - 1\n    if allStates[sID].count <= 0 then \n        allStates[sID].show = false\n    else\n        GenerateName(allStates, sID)\n    end\n    tActiveDOTs[sDestName] = nil    \nend\n\nlocal function AddAura(allStates, sDestName, fTimeSeconds) \n    fTimeSeconds = CalculateCast(fTimeSeconds)\n    \n    local iStacks = 1\n    if tActiveDOTs[sDestName] ~= nil then \n        iStacks =  tActiveDOTs[sDestName].iStacks + 1\n        RemoveAura(allStates, sDestName, fTimeSeconds)\n    end\n    \n    local sID = fTimeSeconds .. \"-\" .. iStacks\n    \n    if allStates[sID] == nil then \n        allStates[sID] = {\n            show = true,\n            tTargetList = {},\n            name = \"\",\n            progressType = \"timed\",\n            expirationTime = GetTime() + 24,\n            duration = 24,\n            autoHide = true,\n            count = 0,\n            stacks = iStacks,\n        }\n    end\n    \n    allStates[sID].changed = true \n    allStates[sID].tTargetList[sDestName] = true \n    allStates[sID].count = allStates[sID].count + 1\n    \n    GenerateName(allStates, sID)\n    \n    tActiveDOTs[sDestName] = {\n        iStacks = iStacks,\n        fTimeSeconds = fTimeSeconds,\n    }\nend\n\n\nlocal function HandleAuraRemoved(allStates, ...) \n    local sDestName = select(9, ...)\n    local fTimeSeconds = select(1, ...) / 1\n    RemoveAura(allStates, sDestName, fTimeSeconds)\nend\naura_env.fnHandleAuraRemoved = HandleAuraRemoved\n\nlocal function HandleAuraApplied(allStates, ...) \n    local sDestName = select(9, ...)\n    local fTimeSeconds = select(1, ...) / 1\n    AddAura(allStates, sDestName, fTimeSeconds)\nend\naura_env.fnHandleAuraApplied = HandleAuraApplied\n\nlocal function CleanUp(allStates) \n    for k, _ in pairs(allStates) do \n        allStates[k].show = false\n        allStates[k].changed = true\n    end\n    tActiveDOTs = {}\n    fLastCast = nil\nend\naura_env.fnCleanUp = CleanUp\n\n",
