				["finish"] = {
				},
				["init"] = {
					["custom"] = "aura_env.autoList = {strsplit(\"/\",aura_env.config.autoList)}\n-- find specific unit to keephiding.\naura_env.spec = function(type,value)\n    local spec_name = {strsplit(\"/\",aura_env.config.names)}\n    local spec_id = {strsplit(\"/\",aura_env.config.ids)}\n    if type == \"name\" then\n        for i = 1,#spec_name,1 do\n            if value == spec_name[i] then\n                return true\n            end\n        end\n    elseif type == \"id\" then\n        for i = 1,#spec_id,1 do\n            if tonumber(value) == tonumber(spec_id[i]) then\n                return true\n            end\n        end\n    else return false\n    end\nend\n-- whether unit with specific mark.\naura_env.spec_marks = function(mark)\n    local boo = false\n    for i = 1,#aura_env.config.marks,1 do\n        if aura_env.config.marks[i] and i == tonumber(mark) then\n            boo = true\n        end\n    end\n    return boo\nend\n-- switcher for \"Only Show\" function.\naura_env.switcher = function(plate)\n    local switcher = false\n    local name = UnitName(plate)\n    for i = 1,#aura_env.autoList,1 do\n        if aura_env.autoList[i] == name then\n            switcher = true\n        end\n    end\n    return switcher\nend\n\n-- adapt to variety addons.\naura_env.visible = function(unit, bool)\n    local plate = C_NamePlate.GetNamePlateForUnit(unit)\n    if type(plate) == \"table\" then\n        if plate and unit then\n            if IsAddOnLoaded(\"Plater\") then\n                if bool then\n                    plate.unitFramePlater:Show()\n                else\n                    plate.unitFramePlater:Hide()\n                end\n            elseif IsAddOnLoaded(\"ElvUI\") and ElvUI[1] and ElvUI[1].NamePlates and ElvUI[1].NamePlates.Initialized\n            then\n                if bool then\n                    plate.unitFrame:Show()\n                else\n                    plate.unitFrame:Hide()\n                end\n            elseif  IsAddOnLoaded(\"NDUI\") and NDuiDB[\"Nameplate\"][\"Enable\"]\n            then\n                if bool then                \n                    plate.unitFrame:Show()\n                else                \n                    plate.unitFrame:Hide()\n                end\n            elseif  IsAddOnLoaded(\"EUI\")\n            then\n                if bool then\n                    plate.unitFrame:Show()\n                else\n                    plate.unitFrame:Hide()\n                end\n            elseif IsAddOnLoaded(\"TidyPlates\")\n            then\n                if bool then\n                    plate.carrier:Show()\n                else\n                    plate.carrier:Hide()\n                end\n            elseif IsAddOnLoaded(\"NeatPlates\")\n            then\n                if bool then\n                    plate.carrier:Show()\n                else\n                    plate.carrier:Hide()\n                end\n            elseif IsAddOnLoaded(\"TidyPlates_ThreatPlates\") then\n                if bool then\n                    plate.TPFrame:Show()\n                else\n                    plate.TPFrame:Hide()\n                end\n            elseif IsAddOnLoaded(\"Kui_Nameplates\") then\n                if bool then\n                    plate.kui:Show()\n                else\n                    plate.kui:Hide()\n                end\n            else\n                if bool then\n                    plate.UnitFrame:Show()\n                else\n                    plate.UnitFrame:Hide()\n                end\n            end\n        end\n    end\nend",
